import React from "react";

export default function HomeView() {
  return (
    <section className="wrapper">
      <div className="container">
        <h1>Hello There!</h1>
        <p>
          We're almost done. Before using our services you need to create an
          account.
        </p>
      </div>
    </section>
  );
}
